import{_ as i,c as t,a8 as a,o as r}from"./chunks/framework.BDnHobkS.js";const u=JSON.parse('{"title":"WiFi Телеметрійне радіо","description":"","frontmatter":{},"headers":[],"relativePath":"uk/telemetry/telemetry_wifi.md","filePath":"uk/telemetry/telemetry_wifi.md"}'),l={name:"uk/telemetry/telemetry_wifi.md"};function o(m,e,n,s,d,f){return r(),t("div",null,e[0]||(e[0]=[a('<h1 id="wifi-телеметріине-радіо" tabindex="-1">WiFi Телеметрійне радіо <a class="header-anchor" href="#wifi-телеметріине-радіо" aria-label="Permalink to &quot;WiFi Телеметрійне радіо&quot;">​</a></h1><p>WiFi telemetry enables MAVLink communication between a WiFi radio on a vehicle and a GCS.<br> WiFi typically offers shorter range than a normal telemetry radio, but supports higher data rates, and makes it easier to support FPV/video feeds. Зазвичай для транспортного засобу потрібен лише один радіоприймач (з умовою, що наземна станція вже має WiFi).</p><p>PX4 підтримує телеметрію через UDP та Wifi. Він транслює сигнал серцебиття на порт 14550 за адресою 255.255.255.255, доки не отримає перший сигнал серцебиття від земної станції керування, після чого він буде надсилати дані лише на цю земну станцію керування.</p><p>Сумісні модулі телеметрії WiFi включають в себе:</p><ul><li><a href="./../telemetry/esp8266_wifi_module.html">ESP8266 WiFi Module</a></li><li><a href="./../telemetry/esp32_wifi_module.html">ESP32 WiFi Module</a></li><li><a href="./../telemetry/3dr_telemetry_wifi.html">3DR Telemetry Wifi</a> (Discontinued)</li></ul>',5)]))}const c=i(l,[["render",o]]);export{u as __pageData,c as default};
